<tr><td class="adminnews" align="left"><div style='position:relative; clear: none; margin-right:12px; float:left; padding-left: 15px;'><a href=user/3><span style='color: rgb(255, 0, 0); font-weight: bold;'> <img src='/images/rang/owner.png'/> Alfons21</span></b></a></div>  09/02/2018 20:51<div style=' text-align:left; float:right; clear:none;  margin-right: 10%;'>„ <i><b>Walka o życie !!!</b></i> ”</div>
</td></tr>
</center></td></tr>
