<table width='100%' style="border-top:1px" solid font-family:Verdana; font-size:11px'>
<tr><td class='pole' width='100%'><i><div align='center'> <a href="http://skarbonka.alivia.org.pl/photos/miroslaw-walczak-754.JPG" target="_blank"><img class='screen' border=0 src="http://skarbonka.alivia.org.pl/photos/miroslaw-walczak-754.JPG"></a><br />
<br />
<br />
<font size=3>Witam,</font><br />
<br />
Nazywam się Mirosław Walczak mam 53 lata. Jestem żonaty i mam dwoje dzieci: syna i córkę. Maciej ma 26 lat, a Julia dopiero 14. Nigdy nie przypuszczałem, że będę zmuszony kiedykolwiek zwrócić się o pomoc z powodu trudnej sytuacji finansowej. W 2011 roku zdiagnozowano u mnie nowotwór złośliwy jelita grubego, gdzie w konsekwencji przeprowadzono operację onkologiczną a potem zastosowano leczenie chemioterapią. Po upływie nie całego roku wróciłem do pracy z nadzieją, że już nigdy nie będę musiał przechodzić takiego etapu w życiu. Niestety w 2015 roku zdiagnozowano u mnie wznowę nowotworu złośliwego tym razem na wątrobie i przeprowadzono kolejną operację. Zaledwie po trzech miesiącach od operacji wróciłem do pracy, gdyż choroba była wykryta na wczesnym etapie i nie potrzebne było już dodatkowe leczenie. Od tego czasu będąc pod częstą kontrolą onkologiczną w Centrum Onkologii w Bydgoszczy, nie minęły jeszcze pełne 2 lata jak ponownie wykryto u mnie nowotwór wątroby.<br />
<br />
W styczniu 2017 roku pojawiły się pierwsze informacje, że prawdopodobnie choroba znów wróciła. Umiejscowienie nowotworu było na tyle trudne, że początkowo stwierdzono że nie jest możliwe przeprowadzenie operacji tylko zastosowanie chemioterapii. Od kwietnia 2017 roku przebywałem już na zwolnieniu chorobowym, a tym samym w tym okresie zastosowano u mnie leczenie onkologiczne. Niestety w czerwcu przeprowadzone badanie Tomografii Komputerowej potwierdziło że chemioterapia nie skutkuje. Po konsultacjach zasugerowano podejście jednak do próby zoperowania nowotworu które okazało się bezskuteczne. Od sierpnia 2017 r po nieudanej operacji onkologicznej dochodziłem do zdrowia i dopiero w październiku zaproponowano innowacyjne leczenie. Dla sprawdzenia skuteczności zastosowanej chemioterapii, w miesiącu styczniu 2018 r przeprowadzono kolejne badanie Tomografii Komputerowej.<br />
<br />
Ostatecznie okazało się, że zastosowana chemioterapia nie przynosi oczekiwanych rezultatów i mało tego, choroba dalej postępuje powodując powstanie kolejnych nowych ognisk nowotworowych. Niestety w pierwszych dniach lutego tego roku odbierając wynik Rezonansu Magnetycznego otrzymałem kolejny cios od życia, gdyż dowiedziałem się że są również przerzuty do kręgosłupa. W związku z bardzo częstymi wyjazdami do Centrum Onkologii w Bydgoszczy ponoszę spore koszty na paliwo związane z dojazdami. W obecnej chwili, od października 2017 r znajduję się na Świadczeniu Rehabilitacyjnym.<br />
<br />
Równolegle w celu wsparcia leczenia korzystam z  medycznej odmiany oleju z konopi indyjskich - z uwagi na towarzyszący mi długotrwały ból kręgosłupa.Cena takiego oleju w zależności od stężenia potrafi być bardzo wysoka.Od kwietnia 2017 r nie pracuję a występując z wnioskiem do swojej firmy ubezpieczeniowej o wypłatę świadczenia z tytułu poważnego zachorowania jakim jest nowotwór, otrzymałem odpowiedź negatywną o braku podstaw do przyjęcia odpowiedzialności i dokonania wypłaty roszczenia z powodu że jest to choroba uznana za przewlekłą i otrzymałem już taką wypłatę za chorobę nowotworową w 2011 roku a tylko raz można otrzymać takie świadczenie. Walczę o leczenie wykraczające poza leki i terapie refundowane, dzięki którym miałbym możliwość wygrania walki z chorobą. Dużą szansą dla mnie są badania genetyczne nowotworu. Polega ono na analizie chorych komórek pod kątem występujących w nich mutacji genetycznych. Jest to szansa na celowane leczenie.<br />
<br />
Nowej generacji leki jak np. z grupy inhibitorów kinaz białkowych, lek skierowany na receptor HER, czy lek celowany, są to leki nierefundowane a cały proces leczenia dopiero przede mną, gdyż dotychczasowe rozwiązania nie przyniosły oczekiwanych efektów a choroba się ciągle pogłębiła. Leki, dojazdy, badania diagnostyczne czy konsultacje są kosztami których samodzielnie nie jestem w stanie już udźwignąć, stąd moja decyzja zwrócenia się o pomoc poprzez fundację.<br />
<br />
Środki zebrane przez Skarbonkę chcę przeznaczyć na pokrycie kosztów dojazdu do szpitala, a także na wspomagające zabiegi hipertermii oraz diagnostykę, leki i rehabilitację. <br />
<br />
Mam nadzieję, że cała akcja pomoże mi wygrać walkę o najwyższą stawkę, jaką jest zdrowie i życie.<br />
<br />
Wierzę, że dzięki Państwa pomocy będę mógł kontynuować leczenie i rehabilitacje, a przede wszystkim że dożyję takiej chwili gdzie będę mógł poprowadzić moją córkę do ołtarza.<br />
<br />
<font size=4><a href=https://skarbonka.alivia.org.pl/miroslaw-walczak rel="nofollow" target=_blank><b>Aby mi pomóc wejdź na <u>SKARBONKA</u> i dokonaj wpłaty. </b></a></font><br />
<br />
Wdzięczny będę za każde wsparcie.<br />
<br />
Pozdrawiam wszystkich, życząc przede wszystkim zdrowia i z góry dziękuję.<br />
<br />
